VALUES ('0184210063748', 'La Choucroute du temps retrouvé', 'Ingrédients : Choucroute au riesling d\'Alsace (52%): choucroute, graisse de canard 1,5%, riesling d\'Alsace1%, oignons, sel, baies de genièvre moulues, poivre, laurier, antioxydant : E300. Pommes de terre cuites (12%): pommes de terre, eau, sel. Knacks d\'Alsace (11%): viande de porc*, eau, viande de boeuf*, gras de porc*, sel, plasma deshydraté, stabilisants: E450, E451, dextrose, épices et extraits d\'épices, arômes naturels, antioxydants : E300, E301, conservateur: E250. Boyau naturel de mouton. Saucisses fumées cuites (8%): viande de porc*, eau, sel, épices et plante aromatique (dont MOUTARDE), sirop de glucose, dextrose, antioxydants: E300, E301, conservateur : E250, arômes naturels. Boyau naturel de porc. Saucisses paysannes (6%):viande de porc*, eau, sel, épices et  plantes aromatiques, plasma deshydraté, arômes naturels, stabilisants : E450, E451, dextrose, antioxydants : E300, E301, conservateur : E250. Boyau naturel de mouton. Kassler fumé cuit (6%): filet de porc*, eau, sel, dextrose, stabilisants : E450, E451, antioxydant : E301, conservateur : E250. Poitrine fumée cuite (5%): poitrine de porc*, eau, sel, dextrose, antioxydant : E301, conservateur : E250. Fumé au bois de hêtre. Pourcentages exprimés sur le total de la choucroute garnie. *Origine UE. Recette préparée dans un atelier qui utilise également du gluten, des oeufs, du lait, de la moutarde et des fruits à coque.', 'https://static.openfoodfacts.org/images/products/018/421/006/3748/front_fr.7.400.jpg', '8.8', '3.2', '12.8', '0.5', '1.9', '6.5', '1.4', '0.551181102362205', '', '0');

